    def openfile(self):
        root_dir = os.getcwd()
        dir = QFileDialog()
        dir.setDirectory(root_dir)
        if dir.exec_():
            nw = dir.selectedFiles()[0]
            fuck = QtGui.QPixmap(nw)
            fuck = fuck.scaled(self.label_11.width(), self.label_11.height(), QtCore.Qt.KeepAspectRatio)
            self.label_11.setPixmap(fuck)
    
